const handleErrors = (response) => {
    if(!response.ok){
        return response.statusText
    }   
    return response
}

export default async function getDish(url){
    return await fetch(url)
        .then(handleErrors)
        .then((res) => {
        try {
            res.json()
        }
        catch {
            console.log(res)
        }
    })
}
